      "id": 27,
      "title_ru": "Нормативность и подрыв",
      "description_ru": "Участницы и участники дискуссии обсудили, каким образом смена этической парадигмы и сопутствующий ей поворот к заботе могут совмещаться с художественным радикализмом и его аффективной составляющей. Егор Рогалев побеседовал с Еленой Петровской, Аллой Митрофановой и Виктором Мизиано.",
      "created_at": "2021-04-08T21:01:53.763Z",
