      "title_en": "Normativity and Subversion",
      "description_en": "The discussion addresses issues related to the importance of maintaining the subversive or constructive potential of art as a political promise of a better world in the context of a new ethical turn that entails a demand for gender equality and attention to the conditions of artistic production. Participants will discuss the ways in which an ethical paradigm shift and the care turn could be combined with artistic radicalism and its affective component.\r\n",
