      "id": 22,
      "title_ru": "Сциапоническая прогулка: Зеленый порядок и новая дикость",
      "description_ru": "Первое из серии «сциапонических упражнений» художника Ильи Долгова, посвященное растительным сообществам и их взаимодействию с людьми прошло на острове Новая Голландия и было сконцентрировано на утилитарно-архитектурных урбанистических техниках озеленения, «новом садоводстве», обращающемуся к образам «дикой природы», устойчивым фитоценозам и биоразнообразию.",
